import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:4000/api/data")
    .then((res) => res.json())
    .then((data) => {
      console.log(data);
      setData(data);
    })
    .catch((error) => console.error(error));
  }, []);

  if (data.length === 0) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <ul>
        {data.map((item) => (
          <div key={item.id}>
            <li>{item.material}</li>
            <li>{item.grade}</li>
            <li>{item.thickness}</li>
            <li>{item.comments}</li>
            <img src={data.image_url} alt="Image" />
          </div>
        ))}
      </ul>
    </div>
  );
}

export default App;
